import React from "react";
import SelectAccountForm from "components/AuthForm/SelectAccountForm";
import { StyleSheet, View } from "react-native";
import { Card, Button, IconButton } from "react-native-paper";
import backIcon from "assets/svg/arrow-left.svg";

const RegisterForm = ({ setShowRegisterForm }) => {
  return (
    <Card style={styles.registerContainer}>
      <Card.Content>
        <SelectAccountForm />
        <Card.Actions style={styles.buttons}>
          <IconButton
            color="#808080"
            icon={backIcon}
            onPress={() => setShowRegisterForm(false)}
          />
          <Button mode="contained">Suivant</Button>
        </Card.Actions>
      </Card.Content>
    </Card>
  );
};

const styles = StyleSheet.create({
  registerContainer: {
    width: "500px",
    marginLeft: "auto",
    marginRight: "auto",
    paddingTop: "80px",
    paddingBottom: "80px",
    borderColor: "#D3D3D3",
    borderWidth: "1px",
    borderRadius: "10px",
  },
});

export default RegisterForm;
